class NzGithubBtnComponent {
    constructor(http, cdr) {
        this.http = http;
        this.cdr = cdr;
        this.starCount = 0;
        this.org = 'NG-ZORRO';
        this.repo = 'ng-zorro-antd';
    }
    getStar() {
        this.http.get(`https://api.github.com/repos/${this.org}/${this.repo}`).subscribe((res) => {
            this.starCount = res.stargazers_count;
            this.cdr.markForCheck();
        });
    }
    ngOnInit() {
        this.getStar();
    }
}


